class Node:
    def __init__(self, data=None):
        self.data = data
        self.next = None

class LinkedList:
    def __init__(self):
        self.head = None

    def push(self, new_data):
        new_node = Node(new_data)
        new_node.next = self.head
        self.head = new_node

    def length(self):
        cur = self.head
        count = 0
        while cur is not None:
            cur = cur.next
            count += 1
        return count

    def nth_from_end(self, n):
        if n < 0:
            raise ValueError("n must be non-negative")
        if self.length() < n:
            raise IndexError("list index out of range")
        cur = self.head
        pos = self.length() - n
        while pos > 0:
            cur = cur.next
            pos -= 1
        return cur.data

